import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import {
  AboutPage,
  ContactPage,
  LandingPagesection,
  NotFoundpage,
} from '../pages/index.js';
import Signup from '../components/Signup.jsx';
import Login from '../components/Login.jsx';

const isAuthenticated = () => {
  const token = localStorage.getItem('token');
  return token ? true : false;
};

const ProtectedRoute = ({ element, ...props }) => {
  return isAuthenticated() ? <Route {...props} element={element} /> : <Navigate to="/login" />;
};

const AppRouter = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/LandingPage" replace />} />
        <Route path="/LandingPage" element={<LandingPagesection />} />
        <Route path="/About" element={<ProtectedRoute element={<AboutPage />} />} />
        <Route path="/Contact" element={<ProtectedRoute element={<ContactPage />} />} />
        <Route path="/Signup" element={<Signup />} />
        <Route path="/Login" element={<Login />} />
        <Route path="*" element={<NotFoundpage />} />
      </Routes>
    </Router>
  );
};

export default AppRouter;
